import React from "react";
import "./store_product-grid.css";

const index = () => {
  return (
    <div className="store__grid-container">
      <div className="store__grid store__container">
        <div className="store__grid--item">1</div>
        <div className="store__grid--item">2</div>
        <div className="store__grid--item">3</div>
        <div className="store__grid--item">4</div>
        <div className="store__grid--item">5</div>
        <div className="store__grid--item">6</div>
        <div className="store__grid--item">7</div>
        <div className="store__grid--item">8</div>
        <div className="store__grid--item">9</div>
        <div className="store__grid--item">9</div>
        <div className="store__grid--item">9</div>
        <div className="store__grid--item">9</div>
      </div>
    </div>
  );
};

export default index;
